import './style-count.css';
import { Row, Col } from 'antd';
import count1 from '../../images/count1.svg';
import count2 from '../../images/count2.svg';
import count3 from '../../images/count3.svg';

function Count(props) {
  return (
    <>
      <Row style={{ paddingTop: `75px` }}>
        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 5 }}
        >
          <div className="counters">
            <img src={count1} alt="img" />
            <h1>6</h1>
          </div>
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 5 }}
        >
          <div className="counters">
            <img src={count2} alt="img" />
            <h1>6</h1>
          </div>
        </Col>

        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 5 }}
        >
          <div className="counters">
            <img src={count3} alt="img" />
            <h1>6</h1>
          </div>
        </Col>
      </Row>
    </>
  );
}

export default Count;
